import { NextResponse } from 'next/server';
import { getDb } from '../../../lib/db';

// ---------- GET ----------
export async function GET(request) {
  const { searchParams } = new URL(request.url);
  const id = searchParams.get('id');

  try {
    const db = await getDb();
    let rows;
    if (id) {
      rows = await db.get(
        `SELECT * FROM status_types WHERE id = ?`,
        [Number(id)]
      );
      if (!rows) return NextResponse.json({ error: 'Not found' }, { status: 404 });
    } else {
      rows = await db.all(`SELECT * FROM status_types ORDER BY status_order`);
    }
    await db.close();
    return NextResponse.json(rows);
  } catch (err) {
    console.error('GET /api/status_types error:', err);
    return NextResponse.json({ error: 'Internal Server Error' }, { status: 500 });
  }
}

// ---------- POST ----------
export async function POST(request) {
  try {
    const body = await request.json();
    const { status_name, status_color, status_order = 0, is_active = 1 } = body;

    if (!status_name) {
      return NextResponse.json({ error: 'status_name is required' }, { status: 400 });
    }

    const db = await getDb();
    const result = await db.run(
      `INSERT INTO status_types (status_name, status_color, status_order, is_active)
       VALUES (?, ?, ?, ?)`,
      [status_name, status_color, Number(status_order), Number(is_active)]
    );
    const inserted = await db.get(`SELECT * FROM status_types WHERE id = ?`, [result.lastID]);
    await db.close();

    return NextResponse.json(inserted, { status: 201 });
  } catch (err) {
    console.error('POST /api/status_types error:', err);
    if (err?.code === 'SQLITE_CONSTRAINT') {
      return NextResponse.json({ error: 'Duplicate status_name' }, { status: 409 });
    }
    return NextResponse.json({ error: 'Internal Server Error' }, { status: 500 });
  }
}

// ---------- PUT ----------
