      fields.push('status_name = ?');
      values.push(status_name);
    }
    if (status_color !== undefined) {
      fields.push('status_color = ?');
      values.push(status_color);
    }
    if (status_order !== undefined) {
      fields.push('status_order = ?');
      values.push(Number(status_order));
    }
    if (is_active !== undefined) {
      fields.push('is_active = ?');
      values.push(Number(is_active));
    }

